import * as AIIcons from "react-icons/ai";

const sidebarData = [
    {
        title:'Home',
        path:'/',
        icon:<AIIcons.AiFillHome/>,
        cname:'nav-text'
    },
    {
        title:'Courses',
        path:'/courses',
        icon:<AIIcons.AiFillHome/>,
        cname:'nav-text'
    },
    {
        title:'About US',
        path:'/aboutus',
        icon:<AIIcons.AiFillHome/>,
        cname:'nav-text'
    },
    {
        title:'Quick Enquiry',
        path:'/enquiry',
        icon:<AIIcons.AiFillHome/>,
        cname:'nav-text'
    },
    {
        title:'Register',
        path:'/register',
        icon:<AIIcons.AiFillHome/>,
        cname:'nav-text'
    }
    
]
export default sidebarData;
